import React, {Component} from 'react';
import './About.css'
import Title from "../Title/Title";
import SubTitle from "../SubTitle/SubTitle";
import SimpleText from "../SimpleText/SimpleText";
import AboutShortInfo from "./AboutShortInfo";
import AboutCertification from "./AboutCertification";
function About(props){
    const contactTitleText = 'Про мене';
    const contactSubtitleText = 'Марія Шугай';
    const contactSubtitleStyle = {
            'font-weight': '900'
    };
        return (
            <div className="about-section">
                <div className="container">
                    <Title text = {contactTitleText}/>
                    <SubTitle text={contactSubtitleText}/>
                    <div className="about__inner">
                        <AboutShortInfo/>
                        <AboutCertification/>
                    </div>
                </div>
            </div>
        );
}

export default About;
